import styled from 'styled-components';

const Banner = styled.div`
    display: flex;
    width: 100%;
    height: 400px;
    background-color: turquoise;
`;

const Button = styled.div`
    padding: 20px 4px;
    border-radius: 2px;
    background-color: ${blue}
`;

export default {
    Banner,
    Button
}
